import React, {useState} from "react";
import './MyPosts.module.css'
import {Post} from "./Post";

let classes = {'myPosts': 'MyPorts_myPosts__6Q9c6'}


export const MyPosts = () => {


const posts = [
    {id: 1, name: 'Oldos', messagePost: 'Hi! Like my post!', count: 1},
    {id: 2, name: 'Ariel', messagePost: 'Like my post!', count: 15},
    {id: 3, name: 'Inga', messagePost: 'Hi! Like my!', count: 22},
    {id: 4, name: 'Mara', messagePost: 'Like!', count: 2},
]

const postElement =  posts.map((p => {
        return <Post name={p.name} messagePost={p.messagePost} count={p.count}/>
    }))

    return <div className={classes.myPosts}>
        <div>
            <textarea className={'inputTextarea'}/>
        </div>
        <div>
            <button>Add Post</button>
        </div>
        <div className={classes.item}>
            <h3>My posts</h3>
            { postElement }

        </div>
    </div>
}
